            "description": {
                "de-DE": "Zwei Patienten mit anfallsweisen Kopfschmerzen und das Ergebnis war nicht berauschend.  "
            },
            "type": "http://adlnet.gov/expapi/activities/cmi.interaction",
            "choices": [
                {
                    "id": "2426",
                    "description": {
                        "de-DE": "Bei diesen Patienten handelt es sich wohl eher  um Migräne-Patienten. Hier ist die Basistherapie  Migräne-Weg. Wenn die Spannungskopfschmerz-Komponente überwiegt, empfehlen wir, die Schmerz-Weg-Basistherapie mit EMF zu ergänzen. Möchten Sie das b. diesen Patienten einsetzen?"
                    }
                },
